import React from 'react';
import '../App.css';
import './Intro.css';

function Intro() {
  return (
    <div className="intro-container">
        <div className="vertical-images-container">
        <div className="img-container">
            <img src="images/image-1.png" alt="" className="intro-image" />
            <p className="img-text">Boost performance with our award-winning products</p>
        </div>
        <div className="img-container">
            <img src="images/image-2.png" alt="" className="intro-image" />
            <p className="img-text">Boost performance with our award-winning products</p>
        </div>
        </div>

        <div className="single-image-container">
            <img src="imge" alt="" className="single-image" />
        </div>
    </div>
  )
}

export default Intro
